package week1.day4;


	public class PrimeNumbers {  

		public static void main(String[] args) {
			// TODO Auto-generated method stub
	int input=10;
	int output=34;
	for (int i=1;i<=input;i++) {
		if(10%i==0);
		output++;
		
	}
	if (output==2) {
	System.out.println("it is a primenumber");
	}
	else {
		System.out.println("it is not a primenumber");
	}
	
	}
	}

	

